import React, {Component } from 'react';
import { Icon, Label, Menu, Table} from 'semantic-ui-react';

class Cell extends Component {
  render() {
    const { label } = this.props
    return (

        <Table.Cell>
          <Label ribbon>{label}</Label>
        </Table.Cell>

    )
  }
}

export default Cell
